Такие функции компилятор сгенерирует сам, если не написать их. Default constructor - конструктор без аргументов. Destructor - вызывается при выходе из области видимости, используется для освобождения ресурсов. Вызываются в обратном порядке по отношению к порядку вызовов конструктора. ~my_string() { free(data_);
} Copy constructor - конструктор копирования: my_string(my_string const& other) { size_ = other.size_; capacity_ = other.capacity_; data_ = (char*)malloc(size_ + 1); memcpy(data_, other.data_, size_ + 1); } Assignment operator - оператор присваивания, похож на конструктор копирования, но не создает объект, а меняет уже существующий. Поэтому в my_string bb = a; вызывается конструктор копирования, так как объект bb ещё не создан. my_string& operator=(my_string const& other){ if (this != &other) { // важно проверить, что не присваиваем a = a // иначе почистим data_ у себя же free(data_); size_ = other.size_; capacity_ = other.capacity_; data_ = (char*)malloc(size_ + 1); memcpy(data_, other.data_, size_ + 1); } return *this;
} Special member функции позволяют реализовать поведение пользовательским типам аналогично стандартным типам (присваивание, копирование), поэтому если они не написаны, то их генерирует компилятор по следующим правилам: Default constructor - генерируется пустой, если нет других конструкторов. Destructor - генерируется пустой, если не написан. Copy constructor - генерируется, если не написан. Сгенерированный автоматически копирует все поля класса, при этом все члены класса копируются не побайтово, а с вызовом их конструкторов копирования. Дефолтный конструктор копирования будет копировать указатели без выделения новой памяти. Так, например, у двух объектов my_string будут одинаковые указатели на data_ и при выходе из области видимости, оба деструктора вызовут free(data_). Assignment constructor - генерируется, если не написан. Как запретить копирования и присваивания? my_string& operator=(my_string const&) = delete;
my_string(my_string const&) = delete; Также можно явно создать дефолтный конструктор (например, если есть уже какой-то другой и из-за него дефолтный не сгенерируется): my_string() = default;
my_string(my_string const&) = default; Так ещё может быть полезно писать, чтобы явно документировать, что дефолтный подходит. Отличается ли чем-то пустой конструктор от дефолтного? Пустой конструктор - это user-defined конструктор. Класс с default конструктором - это trivially constructible . Для них, например, при создании массива не будут вызываться конструкторы. Если = default писать в определении в какой-нибудь из единиц трансляции, то другие единицы трансляции во время компиляции не знают, что класс trivially constructible и не используют это.

