#define PI 3.14159265
double circumference(double r) { return 2 * PI * r;
} Здесь директива #define определяет макрос с именем PI. Текст, который идет после имени макроса, называется replacement . Replacement отделяется от имени макроса пробелом и распростроняется до конца строки. Все вхождения идентификатора PI ниже этой директивы будут заменены на replacement . При этом препроцессор смотрит целиком токены и не будет заменять, например, часть названия переменной. Результатом препроцессирования примера выше является следующий текст: double circumference(double r) { return 2 * 3.14159265 * r;
} Приведенная выше форма директивы #define называется object-like . Существует вторая форма этой директивы, называемая function-like : #define MIN(x, y) x < y ? x : y
printf("%d", MIN(4, 5)); Результатом препроцессирования этого фрагмента кода является: printf("%d", 4 < 5 ? 4 : 5); Важно понимать, что препроцессор, выполняя подстановки макросов, ничего не знает про приоритет арифметических операций и синтаксическую структуру программы. Рассмотрим следующую программу: #define MIN(x, y) x < y ? x : y
int main()
{ printf("%d", 10 + MIN(4, 5));
} Данная программа выводит 5, тогда как скорее всего программист ожидал вывода 14. Дело в том, что после раскрытия макроса возникает выражение 10 + 4 < 5 ? 4 : 5. Поскольку бинарный + имеет приоритет выше, чем у тернарного оператора, данное выражение разбирается транслятором как (10 + 4) < 5 ? 4 : 5, а не 10 + (4 < 5 ? 4 : 5), как мог ожидать программист, использующий макрос. Чтобы избегать подобных проблем, у function-like макросов, которые раскрываются в выражение, replacement следует брать в скобки. По той же причине имена параметров макроса в replacement , следует брать в скобки. Корректный макрос MIN мог бы выглядеть следующим образом: #define MIN(x, y) ((x) < (y) ? (x) : (y)) Директива #define позволяет определять макросы повторно, при этом, в каждой точке программы силу имеет последний #define данного макроса: X
#define X foo
X
#define X bar
X раскрывается в: foo
bar Replacement макроса не препроцессируется при определении макроса, но результат раскрытия макроса препроцессируется повторно: #define Y foo
#define X Y
#define Y bar
X // раскрывается в bar Что произойдет если replacement макроса M будет содержать использование макроса M? В этом случае возникает рекурсия. По спецификации препроцессор никогда не должен раскрывать макрос M изнутри самого себя, а оставлять вложенный идентификатор как есть: #define M { M }
M // раскрывается в { M } один раз, второй раз M не раскрывается Ещё пример: #define A a{ B }
#define B b{ C }
#define C c{ A }
A
B
C Результат препроцессирования: a{ b{ c{ A } } }
b{ c{ a{ B } } }
c{ a{ b{ C } } }

