Директивы #ifdef, #ifndef, #if, #else, #elif, #endif позволяют отпрепроцессировать часть файла, лишь при определенном условии. Директивы #ifdef, #ifndef проверяют определен ли указанный макрос. Например, они полезны для разной компиляции: #ifdef __x64_64__
typedef unsigned long uint64_t;
#else
typedef unsigned long long uint64_t;
#endif Директива if позволяет проверить произвольное арифметическое выражение. #define TWO 2
#if TWO + TWO == 4
// ...
#endif Директива #if препроцессирует свой аргумент, а затем парсит то, что получилось как арифметическое выражение. Если после препроцессирования в аргументе #if остаются идентификаторы, то они заменяются на 0, кроме идентификатора true, который заменяется на 1. Одно из применений #if - это include guard, которые уже обсуждались ранее .

111.body:
Основной сложностью см. также FAQ Бьярна Страуструпа на тему, почему макросы это плохо. при использовании макросов препроцессора является то, что препроцессор оперирует на уровне токенов, не зная ничего про контекст где макрос раскрывается. Предположим, что определен макрос errno, а где-то ниже программист пытается определить локальную переменную errno. #define errno (*errno_location())
int process() { int errno = 0;
} Результатом препроцессирования этого фрагмента будет: int process() { int (*errno_location()) = 0;
} Как мы видим получившийся в результате препроцессирования фрагмент не объявляет переменную errno. Этот фрагмент не объявляет вообще никакую переменную. В данном конкретном случае программист получит ошибку трансляции: errno.cpp:5:17: error: function ‘int* errno_location()’ is initialized like a variable int errno = 0; ^ Сообщение об ошибке ссылается на некоторую функцию int* errno_location(), которая в пользовательском коде не упоминается. Такие ошибки могут быть запутывающими. При использовании библиотек, которые определяют много макросов с короткими именами это может доставлять неудобство, поскольку эти имена становиться невозможно использовать ни под что другое. Чтобы смягчить такие проблемы, стоит избегать коротких имён макросов: GTK_MAJOR_VERSION - пример хорошего имени макроса. min, check, tmp, out - примеры плохих имен. Второй проблемой при использовании пропроцессора является то, что отладчик ничего не знает про раскрытые макросы. Независимо от того, сколько кода пришло из макроса, отладчик будет работать как будто весь этот код написан в одной строке. Поэтому, как правило, в коде активно использующем макросы, сложно работать с отладчиком.

