В связи с расширение языка, сейчас возможно использовать обычные языковые конструкции, там где раньше использовался препроцессор. Например, изначально препроцессор использовался для того, чтобы определять константы: #define BUFF_SIZE 10240 Без использования препроцессора эту константу возможно объявить как: size_t const BUFF_SIZE = 10240; Аналогично function-like макросы часто можно заменить на inline-функции: #define STREQ(s1, s2) (strcmp((s1), (s2)) == 0) inline bool streq(char const* s1, char const* s2) { return strcmp(s1, s2) == 0;
} В случае когда типы аргументов могут быть различными возможно использование шаблонов: #define MIN(x, y) ((x) < (y) ? (x) : (y)) template <class T>
T const& min(T const& x, T const& y) { return x < y ? x : y;
}

