Посмотрим на такой код: int main() { FILE* a = my_fopen("a.txt", "r"); ... fclose(a);
} Чем это плохо? Нам нужно не забывать закрывать ресурс. Особенно возникают проблемы, если в процессе кидаем исключения, а ресурсов несколько. Здесь придерживаются идиомы RAII - resource allocation is initialization struct file { file(char const* filename, char const* mode) : f(my_fopen(filename, mode)){} file(file const&) = delete; file& operator=(file const&) = delete; ~file() { fclose(f); } FILE* f;
}; Тогда ресурсы проще создавать и не будет проблем с закрытием при исключениях: int main() { file a("a.txt", "r");
} В стандартной библиотеке есть похожий класс - unique_ptr . Он представляет из себя уникальный указатель на объект, который нельзя копировать. При уничтожении указателя автоматически вызывается деструктор объекта, на который он указывает. Обычно его создают через make_unique: std::unique_ptr<file> a = std::make_unique<file>("a.txt", "r"); Через .get() можно получить указатель из unique_ptr: file* ptr = a.get();

