int main(){ int a, b; swap(a, b);
} Такое не скомпилируется. Почему? Каждая единица трансляции транслируется отдельно, а потом всё линкуется. Инстанцирование шаблонов (подстановка) происходит до линковки. По этой причине в swap.cpp мы не можем сгенерить swap<int>, потому что не знаем, что он будет использоваться, а в main.cpp не может сгенерить, потому что нет её тела. Можно определить тело шаблонной функции прямо в swap.h и инклудить в разные файлы. Казалось бы, получим ошибку из-за нескольких определений, но нет. Шаблонные функции помечаются компилятором как inline и не выдаёт ошибку, считая, что они все одинаковые. Так же нельзя использовать incomplete типы как параметр. А указатели на них можно. В стандарте прописано, что инстанцирование происходит только когда необходимо. При этом компилятор может делать это в конце единицы трансляции. template <typename T>
struct foo { T* a; void f(); void g(){ T a; }
};
int main() { foo<void> a; // так скомпилируется a.g(); // а так нет, ошибка из-за void a
} В примере выше видно, что если в коде нет вызова функции g, то всё компилируется, так как она не инстанцируется. С классами работает аналогично: полное тело класса не подставляется, если не требуется. Например: template <typename T>
struct foo { T a;
};
int main() { foo<void>* a; // так скомпилируется a->a; // а так нет, опять ошибка из-за void a
} Почему это важно понимать? Ну например, мы не можем использовать std::unique_ptr на incomplete типе. Ну как не можем. Можем, но получим ошибку, если в коде есть вызов деструктора или другие обращение к объекту. // mytype.h
#include <memory>
struct object;
struct mytype { std::unique_ptr<object> obj;
};
// mytype.cpp
struct object { object(int, int, int){};
};
mytype::mytype() : obj(new object(1, 2, 3)){}
// main.cpp
#include "mytype.h"
int main(){ mytype a; return 0;
} Без main.cpp компилируется, так как у a не вызывался деструктор, поэтому он не инстанцировался. С main.cpp компилятор генерирует деструктор, который вызывает деструкторы всех членов класса, а там unigue_ptr<object>, у которого при компиляции будет инстанцироваться деструктор, а object там incomplete type, поэтому получим ошибку компиляции, так как в unique_ptr есть специальная проверка, что если удаляется incomplete type, то это ошибка. Как решить проблему? Сделать явное определение деструктора mytype в mytype.cpp, где у нас определён object. Ещё пример: template <typename T>
struct base { typename T::mytype a;
};
template <typename T>
struct derived : base<derived<T>> { derived* a; // внутри класса можно ссылаться без шаблонного параметра, будет использоваться текущее инстанцирование typedef T mytype;
};
derived<int> a; // не скомпилируется Почему это не скомпилируется? Посмотрим на пример попроще. template <typename T>
struct base { typename T::mytype a;
};
struct derived : base<derived> { typedef int mytype;
}; Тоже не скомпилируется с ошибкой про incomplete type derived. Почему? Ну потому что derived является incomplete типом, когда инстанцируется base<derived>. В предыдущем примере тот же самый эффект: так как derived шаблонный, то он не инстанцируется сразу, но когда мы инстанцируем derived, то он создаётся как incomplete (complete он станет после подстановки базовых классов), происходит подстановка base и получаем ошибку. Может быть интересно прочитать про идиому CRTP

