} Казалось бы, оператор + не должен находиться, как и swap. Если бы это работало так, то пришлось бы везде писать somelib::operator+ или делать using. Кроме поиска имён, который мы обсудили ранее, есть Argument Depended Lookup. Здесь применяется он тоже: он смотрит на типы аргументов и ищет по неймспейсу, из которого эти типы. Такой поиск запускается только для имён, у которых неквалифицированное имя. У поиска ADL и обычного нет приоритетов, они запускаются оба и кандидаты из обоих уходят в overload resolution. Обычно они либо оба найдут одно и то же, либо обычный не найдет ничего и возьмется из ADL (логично?). При этом ADL ищет по неймспейсу, в котором класс big_integer был определен. Если мы спрячем определение в неймспейс, а функции сделаем в другом месте, то он их не найдёт. Стандартная практика применения: когда есть перегруженные операции или функции типа swap. template <typename U, typename V>
struct my_pair { void swap(my_pair& other) { using std::swap; swap(u, other.u); swap(v, other.v); }
} В таком случае будет запускаться ADL для пользовательских классов и будет находиться их swap. А для встроенных типов будет std::swap добавлять кандидатом.

