Часто можно услышать, что передавать параметры по значению и возвращать результат из функции по значению дорого. Но это не всегда так. Начнём с того, как передаются параметры в функцию. Например, в ABI линукса прописано, что если структура помещается в два регистра, то она передаётся через них. Если структура занимает больше, то есть два варианта: void f(mytype x) { // как передаётся параметр? x.a = 42; }
// псевдокод:
void f(mytype const& x) { mytype x_copy = x; x_copy.a = 42;
}
// вызывающая сторона делает копию и передаёт ссылку
void f(mytype& x) { x.a = 42;
} Можно посмотреть, во что компилируется функция f и увидеть, что это похоже на второй вариант. Этот вариант даёт возможность соптимизировать и избегать лишних копирований. Например, в таком случае: void g() { f(mytype(1, 2, 3)); f(h());
} Если в функцию передаётся rvalue, то компилятор не будет делать лишнюю копию. Таким образом, копия делается, только если функция принимает по значению и в неё передаётся lvalue. Как работает возвращение по значению: mytype f() { return mytype(1, 2, 3); }
// компилится во что-то, похожее на:
void f(void* result) { mytype_ctor(result, 1, 2, 3);
} Эта оптимизация называется Return value optimization : если из функции возвращается rvalue, то копия не создаётся и объект конструируется уже на месте, куда возвращается значение. Начиная с C++17 эта оптимизация обязательна для компилятора и вошла в стандарт под названием Copy elision . Помимо этого, есть оптимизация NRVO (named RVO) , которая позволяет избежать копирования при возврате automatic storage duration объекта. На данный момент эта оптимизация необязательная, но уже есть proposal на внедрение этого в стандарт std::string f() { std::string tmp; for (;;) { tmp += ...; } return tmp;
}
// можно разместить tmp уже на result-е, псевдокод:
void f(void* result) { string_ctor(result, "abc"); for (;;) { *result += ...; }
} Применить её можно не во всех случаях. Например: std::string g() { std::string a("abc"); std::string b("def"); if (flag) { return a; } else { return b; }
} Ещё один пример, когда избегается копирование: void g() { mytype a = f(); // здесь не будет вызван конструктор копирования
} Так всё работало ещё в C++03 , в C++11 помимо оптимизаций, появилась move-семантика

