Начиная с C++11 обычные ссылки называются lvalue-ссылками. Для rvalue-ссылок свойства ссылок сохраняются, но, они биндятся только к rvalue. int main() { int a; int& b = a; int& c = 42; int&& d = a; // ошибка int&& e = 42;
} Теперь можно делать перегрузки для rvalue-ссылок: template<typename T>
struct vector { void push_back(T const&); void push_back(T&&);
} В каждом месте, где делается push_back от rvalue, будет вызываться перегрузка именно для rvalue-ссылки. Важный принцип: именованные переменные они всегда lvalue, независимо от того, какой у неё тип. struct person { person(std::string&& name) { // здесь name - lvalue // this.name = name; - простое копирование this.name = std::move(name); // вызовет move-конструктор }
} Что такое std::move? Это почти что static_cast. Её сигнатура похожа на следующее: template<typename T>
T&& move(T& obj) { return static_cast<T&&>(obj);
} В стандартной библиотеке у move сигнатура немного отличается. Написанная выше функция не может принимать rvalue (например, std::move(42) не скомпилируется), в стандартной библиотеке move устроен таким образом, что он работает и для rvalue тоже. Если мы хотим у конструктора, описанного выше, больше параметров, то делать перегрузки на каждую комбинацию сложно. Какое поведение конструктора мы ожидаем? Для параметров, переданных как lvalue, сделать копию, а rvalue переместить. В языке уже есть конструкция, которая делает то же самое - можно просто принять параметр по значению. struct person { person(std::string name, std::string surname) : name(std::move(name)), surname(std::move(surname)) {}
} Так мы получим нужно поведение за исключением того, что иногда move-конструктор вызовется лишний раз (когда делаем копию и вызываем move). Обычно это оптимизируется и не влияет на производительность, но при необходимости можно сделать разные перегрузки. Не стоит использовать move там, где он не нужен : Иногда может возникать желание написать похожую конструкцию: std::string&& foo() { std::string res; res += "abc"; return std::move(res); } Из-за move такое, скорее всего, скомпилируется, но работать не будет, так как ссылка указывает на локальную переменную, которая уничтожится после выхода из функции. Есть правило, что если даже NRVO не сработало, то при возвращении по значению вызовется move. std::string foo() { std::string res; res += "abc"; return res; // вызовет move при возврате, если не сработало NRVO
}

