Когда мы говорили про shared_ptr, у нас была функция make_shared, которая принимала какие-то аргументы и передавала их в конструктор. Посмотрим на возможные реализацию такой функции (для упрощения на примере одного параметра): template<typename T>
void g1(T a){ f(a);
}
template<typename T>
void g2(T const& a){ f(a);
}
template<typename T>
void g3(T& a){ f(a);
} Все 3 случая не подходят: Принимать по значению неприятно, если объект дорого копировать Принимать по const& не получится, если на самом деле функция f принимает ссылку Принимать по & нельзя, так как она не биндится к rvalue Можно было бы сделать перегрузку с & и const&, но тогда нужно 2^n перегрузок для n параметров, что не очень удобно. Perfect forwarding - принять аргументы и передать их куда-то с теми свойствами, с которыми они пришли (rvalue/lvalue, cv). В C++11 есть специальный механизм для решения этой проблемы. Чтобы понять, как оно работает, нужно познакомиться с правилами вывода ссылок в C++11.

