Чтобы сделать perfect forwarding, нужно как-то запомнить, передавалось в шаблон rvalue или lvalue. В C++11 правила вывода шаблонных параметров были определены специальным образом, который позволяет сохранить эту информацию: template <typename T>
void g(T&& a) { f(a);
} int main { g(42); // rvalue: T -> int, void g(int&&) int a; g(a); // lvalue: T -> int&, void g(int&)
} Такие ссылки (шаблонный параметр + rvalue-ссылка) называются универсальными .

251.body:
Как передавать параметр дальше? Внутри тела функции параметр это именованная переменная, поэтому она lvalue (ситуация очень похожа на то, как вводили std::move). Для этого передачи параметра так, как он пришёл, существует std::forward. Можно сделать так: template <typename T>
void g(T&& a) { f(static_cast<T&&>(a));
} int main { g(42); // rvalue: T -> int, void g(int&&), f(static_cast<int&&>(a)) int a; g(a); // lvalue: T -> int&, void g(int&), f(static_cst<int&>(a))
} Библиотечная функция написана примерно так: template<typename T>
T&& forward(T& obj) { return static_cast<T&&>(obj);
} template <typename T>
void g(T&& a) { f(forward<T>(a));
} Такой forward может быть не очень хорошим по нескольким причинам: Если забыть написать тип явно в вызове, то он будет выводится и выведется не так, как нам надо. Это фиксится следующим образом: template <typename T>
struct type_identity { typedef T type;
}; template <typename T>
T&& forward(typename type_identity<T>::type& obj) { return static_cast<T&&>(obj);
} В STL вместо type_identity используется remove_reference. Так же есть перегрузка для rvalue (T&&), которая применяется, например, для форварда значения, возвращаемого функцией.

