bar: sub rsp, 40 ; add rsp,40 ret Как понять, кто вызывал функцию? (WIP) Stack frame (кадр стека) - условная часть стека, принадлежащая вызванной функции. Содержит стековые переменные, адрес возврата и, опционально, описанный далее frame pointer Компилятор умеет внедрять в файл специальную отладочную информацию: бесплатно по производительности, но занимает место в памяти. Альтернатива: в скомпилированном коде при вызове функции обновляется stack frame pointer (указатель на кадр стека), таким образом кадры образуют односвязный список, а стек можно "раскрутить" (unwind). Плюсы: без лишних телодвижений программа может узнать свой стек вызовов без отладчика. Минусы: при обильном вызове функций теряем в производительности. rbp - регистр, который используется для указания на предыдущий кадр стека. На https://godbolt.org можно посмотреть, что следующий код: int foo(char const*); int bar()
{ char arr[40]; return foo(arr) + 1;
} с флагами -O2 -fno-omit-frame-pointer компилируется во что-то такое: bar: push rbp mov rbp, rsp sub rbp, 40 ; mov rsp, rbp pop rbp ret

