Ну тут опять всё как было на ЭВМ . Разбили выполнение команды на несколько стадий, теперь можем повысить частоту, так как каждая стадия стала проще. Выигрыш в том, что можем давать новые данные на каждом такте. Спекулятивное исполнение : условные переходы дорогие, поэтому мы предсказываем переход, выполняем, а если не угадали, то откатываемя. В общем, ничего нового. Также это называется branch prediction . Можем как выиграть, так и проиграть от этого. Например, в некоторых программах на отсортированном массиве предсказание может улучшить время работы в несколько раз. Полезно писать программу так, чтобы уровень зависимостей команд был как можно меньше (это может также пытаться делать компилятор). Например: int f(int a, int b, int c, int d)
{ return a * b * c * d;
} может скомпилиться в следующий код, чтоб уменьшить количество зависимых умножений: (a* b) * (c * d) imul edi, esi imul edx, ecx imul edx, edi mov eax, edx ret Похожее происходит с циклами. Посмотрим на алгоритм Хаффмана: void count_huffman_weights(char const* src, size_t size)
{ uint32_t count[256] = {0}; for (size_t i = 0; i != size; ++i) ++count[src[i]];
} может быть разбит компилятором на параллельные исполнения. Так будут выглядеть зависимости: Dependencies Но у нас возникают проблемы из-за того, что мы пишем в одни переменные. Как пофиксить? Можем сделать 8 разных массивов-счетчиков. Такая реализация используется в библиотеке Zstandart void count_huffman_weights_improved(char const* src, size_t size)
{ uint32_t count[8][256] = {}; size = size / 8 * 8; for (size_t i = 0; i < size;) { ++count[0][src[i++]]; ++count[1][src[i++]]; ++count[2][src[i++]]; ++count[3][src[i++]]; ++count[4][src[i++]]; ++count[5][src[i++]]; ++count[6][src[i++]]; ++count[7][src[i++]]; }
} ​	Полезные книжки по теме: J. Shen, M. Lipasti — Modern Processor Design: Fundamentals of Superscalar Processors J. Hennessy, D. Patterson — Computer Architecture: A Quantitative Approach

