Compilation graph Классическая схема этапов компиляции. Есть похожая статья на хабре . Preprocessing g++ -E -P 1.cpp -o 1.i Выполняет директивы (#define, #include и другие). #include - вставляет текст из указанного файла #define - задает макрос Translation g++ -S -masm=intel 1.i -o 1.s Трансляция кода в ассемблер. Assembling g++ -C 1.s -o 1.o (либо as ...) Транслирует ассемблерный код в машинный код. *.o - объектный файл Linking g++ 1.o -o program (либо ld ...) Связывает все объектные файлы и библиотеки в один исполняемый файл. После этого этапа можно запускать ./program. *.cpp файлы так же называют единицами трансляции Пример линкования файликов: // a.cpp: int main() { f(); }
// b.cpp:
#include<cstdio>
void f() { prinf("Hello world");
} Это не скомпилится, так как на этапе до линковки компилятор не знает о существовании f() где то вне a.cpp, поэтому ее надо объявить: // a.cpp: void f(); int main() { f(); }
// b.cpp:
#include<cstdio>
void f() { prinf("Hello world");
} Для линковки вместеg++ a.o b.o Функцию нужно объявлять до её вызова. Если в обеих программах есть main, то невозможно будет слинковать (какой main запускать?) В main можно не делать return, по умолчанию вернёт 0. Можно писать функцию на ассемблере и вызывать из *.cpp файла, потому что на этапе линковки нет разницы. Во всех единицах трансляции только одно определение. Функцию нужно объявлять до её использования. Если она описана ниже, то транслятор не увидит её и кинет ошибку.

