static - переменная или функция - "не предоставляется наружу", видна только в одной единице трансляции. При этом если в другой единице есть функция с такой же сигнатурой, но в текущей единице она static, то не будет проблемы с multiple definition, а в текущей единице трансляции выберется static. Для функций void f(); это объявление (declaration), а void f(){} -- определение (definition). Для переменных немного иначе: int a - определение extern int a - объявление (означает, что переменная объявлена где-то снаружи). Глобальные переменные инициализируются нулями при определении, в отличие от локальных. Можно заметить, что при линковке нам не важно, откуда приходят функции, исходный код одной из единиц трансляций может быть сразу на ассемблере: extern "C" uint32_t fibonacci(uint32_t n);
// определена, например, в .s файле, но должны выполняться calling conventions extern "C" f - использовать СИшное имя функции. На имена функций можно посмотреть так: nm a.o, nm -C a.o. В Си имя функции выглядит как f, в C++ как _Z1fd, где d - типа аргумента, который она принимает (тут double). Это связано с тем, что в Си нет перегрузки функций, поэтому там имена функций не декорируются типами их аргументов. У функций с разными сигнатурами, но помеченных как extern "C", после компиляции не будет информации об типах их аргументов, поэтому это даже слинкуется, но работать не будет (ну либо будет, но тут UB, так как, например, типы аргументов ожидаются разные). Возьмём теперь объявление printf из cstdio и вставим его вручную: extern "C" int printf(const char*, ...);
int main() { printf("Hello, world!");
} Такая программа тоже работает. Откуда берётся printf? Ответ кроется в том, что при компиляции командой g++ -c b.cpp вызывается команда линковки ld с ключом, из-за которого файл линкуется с объектными файлами из стандартной библиотеки. Если посмотреть, то можно заметить, что наш файл линкуется с несколькими другими объектными файлами, один из которых содержит функцию _start (это может быть файл crt1.o), которая вызывает main.

73.body:
2.h - файлы не участвующие в компиляции, в них пишут объявления функций. Не нужно делать #include file.cpp, а в .h не нужно определять функции. Зачем это нужно? Как сказано выше, во всех единицах трансляции может быть только одно определение функции, потому что иначе получим redefinition error, так как компилятор не сможет выбрать из нескольких определений функции одно. Поэтому делаем на все единицы трансляции одно определение в .cpp файле, в хедерах объявления. Теперь, когда мы будем инклудить хедеры в другие единицы трансляции, у нас будет в них появляться только объявление функций из хедера. Структуры/классы пишем в .h. При этом их методы можно определять там же, потому что они воспринимаются компилятором как inline. Посмотрим на то, как работает #include: // x.h:
struct x {}; // y.h:
#include "x.h"
// z.h:
#include "x.h" a.cpp: #include "y.h" --> struct x{};
#include "z.h" struct x{}; //ошибка компиляции Решение: #include "x.h" не писать в хедерах, а только по необходимости в .cpp (не очень решение) // x.h: #ifndef X_H #define X_H // - макрос struct x{}; #endif Это решение называется include guard Тогда при #include x.h будет проверка, заинклудили ли его уже и не будет проблем. Директива #pragma once - стандарт не поддерживает, но поддерживают, кажется, все компиляторы. Эффект как у include guard , но проще писать и нет проблемы с тем, что можем еще где-то сделать лишний #define X_H Если меняется header , то необходимо перекомпилировать все файлы, которые подключают его (даже не непосредственно), что может быть неприятно. #define PI 3.14 // препроцессор подставляет вместо PI 3.14 Макросы обычно пишут капсом

