Хотим две структуры в разных хедерах a.h и b.h. В структуре a указатель на структуру b и наоборот. // main.cpp:
#include "a.h"
#include "b.h" Если в a.h инклудится b.h и наоборот, то получим ошибку во время компиляции. Как фиксить? Если нам не требуется знать, что находится внутри структуры, можно использовать forward declaration . Например, a.h будет выглядеть так: struct b;
struct a { b* bb;
}; Важно : избегайте циклических инклудов, чаще всего это приводит к ошибкам. Пока структуру не определили, структура - это incomplete type . Например, на момент объявление struct b; в коде выше, b - incomplete. Все, что можно с ними делать - это объявлять функции с их использованим и использовать указатель. Становятся полным типом после определения. Бонусом с forward declaration получаем, что нужно меньше перекомпилировать, так как меньше инклудов. А теперь такой пример: // a.cpp
#include <iostream>
struct x { int a; // padding double b; int c; int d;
}
int main(){ x xx = f(); std::cout << xx.a << " " << xx.b << " " << xx.c << " " << xx.d << "\n";
} // b.cpp
struct x { int a; int b; int c; int d; int e;
}; x f() { x result; result.a = 1; result.b = 2; result.c = 3; result.d = 4; result.e = 5;
} Тут стоит вспомнить, что структуры при линковке не играют никакой роли, то есть линковщику всё равно, что у нас структура x определена в двух местах. Поэтому такая программа отлично скомпилируется и запустится, но есть одна проблема. В b.cpp определение функции f скомпилируется с учётом смещений в структуре, определённой в этой же единице трансляции, то есть будто там лежит 5 интов. Поэтому следует придерживаться правила определять структуры один раз и не писать разные структуры с одним названием.

