cppreference: operator overloading В С++ есть возможность определять собственные операторы для классов: complex operator+(complex a, complex b) { return complex(a.re + b.re, a.im + a.im)
} Если вы пишете какой то оператор, то хотя бы один из его элементов должен быть пользовательским типом (нельзя переопределить оператор для int, int, но можно, например, для vector и int). Еще пример: complex operator+=(complex a, complex b) {} Мы такое сделать не можем, так как нужно поменять а, то есть передать его по указателю: &a += b, что не очень естественно. Сделать такое можно, используя ссылки: указатель ссылка int* p = &a; int& r = a; *p = 5; r = 5; int *pp = p int* pr = &r; p->foo p.foo; p = &b; // нельзя перенаправить Нужно делать так: complex& operator+=(complex &a, complex b) { // возвращает ссылку, так что можно присвоить куда-то результат a += b; // поэтому можно (a += b) += c; return a = a + b;
} Если мы принимаем экземпляр класса и нам не нужно его менять, можно передавать его по константной ссылке, тогда мы избегаем лишних копирований (в отличие от передачи по значению): std::ostream& operator<<(std::ostream& os, complex const& a) { os << a.real << " + " << a.im << "i"; return os;
} Если функция принимает const&, то в неё можно передавать временный объект (rvalue). Если же она принимает обычную ссылку, то только lvalue. Аналогично возвращая по ссылке, возвращаем lvalue, а по значению rvalue.

