Операторы можно перегружать как функции (снаружи класса) и как методы (внутри класса). Соответственно, у операторов, перегруженных как методы, первым аргументов будет неявный this. У операторов может срабатывать неявное приведение типов (если есть не explicit конструктор). При этом если оператор перегружен как функция, то приводится любой из аргументов, а если как метод, то только правый. Примеры: // как методы:
struct A { A (int a); // не explicit конструктор A operator-() const; // -(*this) A operator-(A const& w) const; // (*this) - w, нельзя вызвать (2-v)
} // как функции:
A operator-(A const& v);
A operator +(A const& v, A const& w);
// можно вызвать как (2-v), так как есть не explicit конструктор от int Можно делать аргументы оператора другого типа но тогда его нужно перегрузить как функцию, если первый аргумент другого типа. Vector operator*(double d, Vector const& v); Некоторые операторы необходимо перегружать только внутри класса: (type), [], (), ->, ->*, =. Вот так перегружается оператор (), заметьте, что можно сделать это для разного количества аргументов: bool operator()(double d) const;
void operator()(double a, double b); Пример инкремента и декремента : Чтобы отличать их, постфиксный перегружают с неиспользуемым ( dummy ) параметром типа int. Когда вызывается постфиксный оператор, всегда передаётся аргумент, хотя можно и вручную вызвать оператор как функцию и передать любое значение:a.operator++(2). struct big_integer { big_integer & operator++() { // prefix // ... return *this; } big_integer operator++(int) { // postfix big_integer tmp(*this); ++(*this); return tmp; }
} Пример оператора приведения в стиле C: struct String { operator bool() const { // приведение к bool return size_ != 0; } operator char const*() const { // приведение к char const* if (*this) { return data_; } else { return ""; } } // ...
} Аналогично можно перегружать и касты в стиле C++ (static_cast и др.). У операторов приведения, как и у конструкторов, можно указывать модификатор explicit и запрещать неявное приведение. Некоторые ограничения: Оператор -> должен возвращать указатель или объект класса, для которого он переопределён (по ссылке или по значению). Операторы &&, || при перегрузке теряют своё специальное поведение и ведут себя как обычные функции. Операторы += и подобные лучше перегружать внутри класса, а + снаружи через +=. Тогда для + будет работать приведение типов. Операторы сравнений стоит определять одновременно и согласованно: если определили какой-то один из них, принято определить и все остальные так, чтобы они не противоречили друг другу. Хорошим тоном считается соблюдать стандартный смысл операторов: не перегружать оператор + как умножение. Приоритет операторов остаётся стандартным.
